INSERT INTO public."Product" ("name",description,old_price,new_price,image,available,created_at) VALUES
	 ('REDCON1 MRE Meal Replacement – Bữa ăn thay thế thơm ngon phục hồi và sửa chữa cơ hiệu quả','MRE Meal Replacement được tin dùng bởi quân đội Mỹ. Nguồn dinh dưỡng tối ưu cũng như tính tiện lợi sản phẩm giúp những người lính bổ sung tốt năng lượng sau những giờ phút hoạt động mạnh mẽ ngoài chiến trường.',0,1750000,'https://res.cloudinary.com/dr98sm712/image/upload/v1712160591/rldk2bb5etmnfwnmk6ov.png',34,'2024-03-10 09:28:24.981'),
	 ('REDCON1 MRE RTD – Thức Uống Protein Pha Sẵn Có Hương Vị Thơm Ngon Nhất','MRE® PROTEIN SHAKE có cấu hình thành phần tương tự như toàn bộ dòng MRE: nguồn protein thực phẩm toàn phần, không chứa bất kỳ whey hoặc lactose nào và hương vị thơm ngon. ',0,1300000,'https://res.cloudinary.com/dr98sm712/image/upload/v1712160501/salcgtyxnlbjbbladpbb.jpg',43,'2024-03-10 09:28:24.981'),
	 ('ALPHA PUMP Hỗ Trợ Pump Cơ Hiệu Quả','Hỗ trợ tăng cơ bắp của bạn thông qua tăng lưu lượng máu, oxy và chất dinh dưỡng – Cải thiện hiệu suất tập luyện, năng lượng và sức bền – Tăng cường kết nối từ não đến cơ bắp với nootropics liều lâm sàng ',0,2000000,'https://res.cloudinary.com/dr98sm712/image/upload/v1712160546/ozwgintb3uwnekpjvpgq.jpg',65,'2024-03-10 09:28:24.981'),
	 ('AMINO K.E.M Nguồn Năng lượng tập luyện cao cấp nhất','Amino K.E.M bổ sung năng lượng tập luyện sẽ giải quyết điều đó. Sản phẩm intra workout cao cấp này sẽ bổ sung năng lượng EAA+, với 9 loại acids thiết yếu tăng khả năng hồi phục cho bạn.',0,1200000,'https://res.cloudinary.com/dr98sm712/image/upload/v1712160552/glyw4tnxi3cnvl7wsy4h.jpg',65,'2024-03-10 09:28:24.981'),
	 ('Lipo 6 Black Hers – TPBS hỗ trợ giảm cân cho nữ','Lipo 6 Black Hers giúp tăng cường quá trình trao đổi chất kích thích đốt cháy calo. Sản phẩm hỗ trợ kiểm soát sự thèm ăn giúp ngăn chặn cảm giác thèm ăn và ăn quá nhiều.',0,1750000,'https://res.cloudinary.com/dr98sm712/image/upload/v1712160558/ystogoysnhw6e2rucca0.jpg',34,'2024-03-10 09:28:24.981'),
	 ('ISO Whey LABRADA -Whey Protein Isolate','100% Whey Protein Isolate, không chứa Gluten, không chứa Lactose, không chứa đường, ít Carbs, có chứa Glutamine hỗ trợ tốt cho việc phục hồi\n',0,2300000,'https://res.cloudinary.com/dr98sm712/image/upload/v1712160438/wnq4rjvakmfqr5hovwna.jpg',22,'2024-03-10 09:28:24.981'),
	 ('Super Huge Gain - MASS Evogen tăng cân đẳng cấp nhất','Super Huge Gain chứa 50 gram nguồn protein cao cấp hoàn chỉnh tăng trưởng cơ bắp tối đa kết hợp nguồn carb phức, giàu xơ hạn chế lên mỡ. Mass cao năng lượng tăng cân nhanh hương vị thơm ngon thanh khiết.',0,2000000,'https://res.cloudinary.com/dr98sm712/image/upload/v1712160563/lhtqhwfpb9e4gkpgk5ai.jpg',43,'2024-03-10 09:28:24.981'),
	 ('RSP AminoLean Năng lượng Gym bùng nổ','Amino thiết yếu phục hồi cơ bắp - BCAA xây dựng cơ nạc. L-Carnitine đốt mỡ và giảm đau cơ - Caffeine và Trà xanh thiên nhiên đốt mỡ và cảm nhận tốt cơ 0 đường 0 calo 0 carb - Mùi vị tuyệt vời',0,599000,'https://res.cloudinary.com/dr98sm712/image/upload/v1712160452/khequk5aibisvoefaqtv.jpg',78,'2024-03-24 13:59:49.315'),
	 ('ISOJECT Premium EVOGEN – Whey Isolate tăng cơ VIP nhất','Bạn là người ăn chay và muốn sử dụng protein có nguồn gốc thực vật. Chúng tôi có thể đảm bảo với bạn PLANT PROTEIN sẽ mang đến hương vị thơm ngon thực sự, khả năng pha trộn tuyệt vời và kết cấu mịn..',0,2300000,'https://res.cloudinary.com/dr98sm712/image/upload/v1712160459/s2jrr1ze4yy6jny6zucj.jpg',100,'2024-03-10 09:28:24.981'),
	 ('LEAN BODY RTD PLANT BASED – BỮA ĂN THAY THẾ THUẦN CHAY, GIÀU PROTEIN','Bạn là người ăn chay và muốn sử dụng protein có nguồn gốc thực vật. Chúng tôi có thể đảm bảo với bạn PLANT PROTEIN sẽ mang đến hương vị thơm ngon thực sự, khả năng pha trộn tuyệt vời và kết cấu mịn..',0,2100000,'https://res.cloudinary.com/dr98sm712/image/upload/v1712160471/lmz5dgsmxju5so0ueayn.jpg',299,'2024-03-10 09:28:24.981');
